import React from "react";
import { Link } from "react-router-dom";

const HomePage = () => {
  return (
    <div>
      <Link to="/loginpage">
        <button>Login</button>
      </Link>
      <Link to="/signuppage">
        <button>Sihgn UP</button>
      </Link>
    </div>
  );
};


export default HomePage;
